import { Slider, Switch } from 'antd';
import { useState } from 'react';


const RangeSlider = (props) => {
    const [v, setV] = useState(0);

    return(
        <div>
        <p>{v}</p>
        <Slider 
            range defaultValue={[props.min, props.max]} 
            step={1} 
            min={props.min} 
            max={props.max} 
            onChange={(value)=>setV(value)}
        />
        </div>
    )
}

export default RangeSlider
